  <text id="xmas" style="fill: rgb(204, 35, 30); font-family: Algerian; font-size: 34px; font-weight: 700; line-height: 103.543px; white-space: pre;"><textPath id="myPath" startOffset="-307" xlink:href="#path-0"><tspan>MERRY CHRISTMAS!</tspan><tspan x="0" dy="1em">​</tspan></textPath></text>
</svg>

    <script
      src="https://cdnjs.cloudflare.com/ajax/libs/gsap/3.11.3/gsap.min.js"
      integrity="sha512-gmwBmiTVER57N3jYS3LinA9eb8aHrJua5iQD7yqYCKa5x6Jjc7VDVaEA0je0Lu0bP9j7tEjV3+1qUm6loO99Kw=="
      crossorigin="anonymous"
      referrerpolicy="no-referrer"
    ></script>
    <script>

      
let numFlakes = 30
let width = window.innerWidth
let height = window.innerHeight
const izp = gsap.utils.toArray("#itzy path");
      const izd = document.querySelector("#izdemo");


function createFlake() {
	let flake = document.createElement("div")
	let flakeClass = "flake flake" + gsap.utils.random(1,4,1)
	flake.setAttribute("class", flakeClass)
	document.body.appendChild(flake)
	return flake
}


function animateFlake(flake) {
	
	let scaleFactor = Power3.easeIn(Math.random()) //change to easeOut for more larger flakes
	let scale = gsap.utils.interpolate(0.3, 0.6, scaleFactor)
	let duration = gsap.utils.interpolate(2,4, 4-scaleFactor)
	let opacity = gsap.utils.interpolate(0.5, 1, scaleFactor)
	gsap.set(flake, {y:-1200, x:gsap.utils.random(0,width), scale:scale, opacity:opacity})
  const itzytt = gsap.timeline({paused:true})
  .to(flake, {y:height + 200, x:"+=200", 
						 duration:duration, 
						 delay:18, 
						 ease:"none",
						 rotation:"random(-60, 200)",
						 onComplete:animateFlake, 
						 onCompleteParams:[flake]})

             izd.addEventListener("click", () => itzytt.play(!itzytt.play()));
}


for(let i = 0; i < numFlakes; i++){
	let flake = createFlake()
	animateFlake(flake)
}


  

      gsap.set(izp, { fillOpacity: 0 });
      gsap.set(izd, { autoAlpha: 1 });
      

      izp.forEach((dot, index) => {
        let close = dot.querySelector("#reverse");
        const izd = document.querySelector("#izdemo");
        let length = dot.getTotalLength();
        console.log(length);
        gsap.set(dot, {
          strokeDasharray: length,
          strokeDashoffset: length,
          strokeWidth: 1.5,
        });

        const itzt = gsap.timeline({ paused: true }).to(dot, {
          duration: 10,
          strokeDashoffset: 0,
          ease: "linear",
          stagger: 0.001,
        }
        )
        .to(dot, {strokeWidth:0.7});

        izd.addEventListener("click", () => itzt.play(!itzt.play()));
      });

      const itzyt = gsap
        .timeline({ paused: true })
        .to(izp, { delay:11, fillOpacity: 1, stagger: 0.001, ease: "sine.in" })
        .to( "#img",{ opacity:1, ease: "sine.in", duration: 0.5 })
        .to("#itzy", {opacity:0, duration:0.5, ease: "sine.out"})
        .to("#xmas", {startOffset:0, duration:3, ease: "sine.inOut"})
        .to("#myPath", {attr:{startOffset:0}, duration:2, ease:"bounce.out"}, "<")
        

      izd.addEventListener("click", () => itzyt.play(!itzyt.play()));
    </script>
